import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";

const Set=()=>{
  
  const M=new Date().getHours();
  const N=new Date().getMinutes();
  const O=new Date().getSeconds();
 

  const state = useState();
  let [Any,what] = useState(new Date().getTime());
  
const Inn=() => {
  what(` ${M}:${N}:${O}`);
};
   
  return (
  <>
      <h1>{Any}</h1>
      <button onClick={Inn}>tap on</button>
  </>
  );





 }




ReactDOM.render(
   <>
   <Set />
   </>
 
  ,document.getElementById("root"));
